INSERT INTO `project` VALUES (1,NULL,'2022-02-04 14:19:20.121508',_binary '\0',NULL,'2022-02-04 14:19:20.121508','END','SSAFY 공통 프로젝트 같이 하실 분 계신가요?\r\n\r\n저희는 SSAFY 교육생만을 위한 커뮤니티를 만들고 싶어요~!\r\n프로젝트, 스터디 팀원을 구할 수 있고, 미팅룸으로 바로 이동해서 회의나 개발을 할 수 있게 할 예정입니다!\r\n\r\n많은 관심 부탁드려요!!!!','2022-02-18',204,7,'Backend',4,'2022-02-14','싸피사만코',2,0,2,0),(2,NULL,'2022-02-07 23:08:05.787589',_binary '\0',NULL,'2022-02-07 23:08:05.787589','ING','팥붕과 슈붕 중 어떤 게 더 인기 많을지 알아보는 투표 서비스입니다 ㅎㅎ\r\n\r\n간단한 사이드 프로젝트로 진행될 예정입니다!\r\nFE는 React로, BE는 Spring Boot를 사용할 예정이에요!\r\n기획부터 배포까지 같이 하실 분 구합니다~~~~','2022-02-28',642,13,'Frontend',4,'2022-02-16','팥붕 대 슈붕!!',2,0,2,0),(3,NULL,'2022-02-09 02:08:15.304193',_binary '\0',NULL,'2022-02-09 02:08:15.304193','ING','구합니다!\r\n\r\njenkins 사용자 우대합니다 . . . ^_ㅠ','2022-02-23',185,1,'Frontend',5,'2022-02-08','배포 잘하시는분',2,0,3,0),(4,NULL,'2022-02-09 11:44:04.376416',_binary '\0',NULL,'2022-02-09 11:44:04.376416','ING','포장마차에 가서 오뎅을 먹을지, 계란 말이를 먹을지 고민.. 해보셨나요?\r\n그럼 저희 같이 프로젝트 해봐요!\r\n\r\n책임감 있게 오래오래 하실 분 구합니다!!!','2022-02-28',226,46,'Mobile',4,'2022-02-18','포장마차 메뉴 추천 서비스',2,0,0,2),(5,NULL,'2022-02-09 15:45:38.925168',_binary '\0',NULL,'2022-02-09 15:45:38.925168','ING','테스트중','2022-02-09',101,17,'Backend',3,'2022-02-09','취업뽀각',3,0,0,0),(6,NULL,'2022-02-09 15:54:15.103350',_binary '',NULL,'2022-02-09 15:54:15.103350','END','흠흠','2022-02-09',552,2,'Frontend',4,'2022-02-09','흠흠!',2,0,2,0),(7,NULL,'2022-02-14 09:23:59.766977',_binary '',NULL,'2022-02-14 09:23:59.766977','ING','싸피사만코2 프로젝트입니다','2022-02-20',1,23,'Frontend',3,'2022-02-16','싸피사만코2',0,0,3,0),(8,NULL,'2022-02-14 09:56:37.720879',_binary '',NULL,'2022-02-14 09:56:37.720879','ING','프로젝트','2022-02-24',1,23,'Frontend',4,'2022-02-14','프로젝트2',2,0,2,0),(9,NULL,'2022-02-14 20:20:23.207016',_binary '\0',NULL,'2022-02-14 20:20:23.207016','ING','같이 플젝할사람~','2022-02-28',13,21,'Backend',6,'2022-02-14','뭐라하지',3,0,3,0),(10,NULL,'2022-02-14 21:01:36.792895',_binary '\0',NULL,'2022-02-14 21:01:36.792895','ING','CRUD 기반으로 